    false,nt"url": null,nt"notes": "World Ocean Database 2001 (WOD01) is comprised
    of 8 CD-ROMs and contains in situ profile data such as temperature, salinity, nutrients,
    oxygen, chlorophyll, plankton biomass data and more. It is an update to the World
    Ocean Database 1998, plus it contains some new parameters.nnSome changes since WOD98:n-
    addition and specification of data from undulating oceanographic recorders, profiling
    floats, drifting buoys, moored buoys, surface only data, and autonomous pinniped
    bathythermograph data;n- addition of carbon variables to the database;n- submitter-defined
    data quality flags received as part of data submissions are now kept in the database;n-
    modifications to the data format.nnCopies of these discs are currently available
    via the NODC Online Store atnhttp://ols.nndc.noaa.gov/plolstore/plsql/olstore.prodspecific?prodnum=W00082-CDR-S0001.",nt"license_title":
